 * @param {Object} index
 * @param {Number} start
 * @returns {Number}
 */
function getSegmentIndex(index : ITimelineIndex, start : number) : number {
  const { timeline } = index;

  let low = 0;
  let high = timeline.length;

  while (low < high) {
    const mid = (low + high) >>> 1;
    if (timeline[mid].start < start) {
      low = mid + 1;
